            $res = $this->getData($shop, $cid);
            if (substr($res,0, strlen($str)) != $str){
                sleep(1);
                $res = $this->getData($shop, $cid);
                if (substr($res,0, strlen($str)) == $str){
                    sleep(1);
                    $res = $this->getData($shop, $cid);
                }
            }
            $data[] = [
                'shop' => $shop,
                'cid' => $cid,
                'data' => $res,
            ];
            if (count($data) >= 20){
                MarketModel::insert($data);
                $data = [];
            }
            echo 1;
//            sleep(1);
        }
        if ($data){
            MarketModel::insert($data);
        }
